import React from "react";
import Card from "./components/Card";
import jobBoards from "./jobBoards.json";

import "./App.css";

const Cards = (props) => {
  console.log("Jobs Data", props.jobData);
  props.jobData.map((data, i) => {
    return (
      <Card
        key={i}
        description={data.description}
        logo={data.logo_file}
        rating={data.rating}
      />
    );
  });
};

function App() {
  const jobs = jobBoards.job_boards;

  return (
    <div className="App">
      <div className="job--source--container">
        <h1>Job Source Resolver</h1>
        <div className="job--cards--container">
          <section className="job--cards">
            <Cards jobData={jobs} />
          </section>
        </div>
      </div>
    </div>
  );
}

export default App;
